import profilePhoto from '../images/Avatar.png'

function Main(){
    function handleEditAvatarClick(){
        const profileAvatar = document.querySelector('.profile__button-avatar');
        console.log(profileAvatar)
    }
    handleEditAvatarClick()

    return(
        <main>
        <section className="profile">
          <button className="profile__button-avatar" type="button">
            <img src={profilePhoto} alt="Аватар" className="profile__avatar" />
          </button>
          <div className="profile__info">
            <h1 className="profile__name">Жак-Ив Кусто</h1>
            <button className="profile__edit-button" type="button"></button>
            <p className="profile__occupation">Исследователь океана</p>
          </div>
          <button className="profile__add-button" type="button"></button>
        </section>
        <section className="grid">
        </section>
      </main>
    )
}

export default Main;
